import React from 'react';

const ProfileCard = () => {
  const cardStyle = {
    position: 'relative',
    display: 'inline-block',
    textAlign: 'left',
    color: 'black',
  };

  const imageStyle = {
    display: 'block',
    width: '100%',
    borderRadius: '10px',
  };

  const textBoxStyle = {
    position: 'absolute',
    top: '10%',
    left: '5%',
    backgroundColor: 'rgba(211, 211, 211, 0.8)', // Light grey with opacity
    padding: '10px',
    borderRadius: '5px',
  };

  const textStyle = {
    fontFamily: 'Arial, sans-serif',
    fontSize: '18px',
    fontWeight: 'bold',
  };

  return (
    <div style={cardStyle}>
      <img 
        src="./profile-pic.jpg" 
        alt="Ethan Feiges" 
        style={imageStyle} 
      />
      <div style={textBoxStyle}>
        <div style={textStyle}>Ethan Feiges</div>
        <div style={textStyle}>College: UW-Madison</div>
        <div style={textStyle}>Major: CS</div>
        <div style={textStyle}>Year: Sophomore</div>
        <div style={textStyle}>Age: 19</div>
      </div>
    </div>
  );
};

export default ProfileCard;
